snippet.description:
@chingssecret  Tasty, Restaurant style fried rice can be made easily at home in less than 10 minutes! You only need vegetables of your choice, leftover/ cooked rice and Ching’s Secret Schezwan Fried Rice Masala. 

Ching’s Secret range of Desi Chinese Masalas, Instant noodles, Hakka Noodles, Soups, Schezwan Chutney and sauces is available at a grocery store near you or you can order online on BigBasket, Swiggy Instamart, Blinkit, Dunzo, ZEPTO.

#ILoveDesiChinese #ChingsSecret

